import Home from './Views/Home'
import { CharacterDetail } from './Views/CharacterDetail';
import { PlanetDetail } from './Views/PlanetDetail';

 export const routes = [
  {
    path: '/',
    element: <Home />
  },
  {
    path: '/character/:id',
    element: <CharacterDetail />
  },
  {
    path: '/planet/:id',
    element: <PlanetDetail />
  }
]
